import React from 'react';
import './Modal.css';

export default function Modal({ imageSrc, onClose }) {
    if (!imageSrc) return null;

    return (
        <div className="modal-backdrop" onClick={onClose}>
            <div className="modal-content">
                <img src={imageSrc} alt="Enlarged" />
            </div>
        </div>
    );
}
